using System.Collections.Generic;using System.Reactive;using ReactiveUI;namespace SchoolTimetabler.ViewModels;public class MainWindowViewModel : ViewModelBase, IScreen{    public List<string> DisciplinesName = new();    public MainWindowViewModel()    {        GoTimetableInfo = ReactiveCommand.CreateFromObservable(            () => Router.Navigate.Execute(new TimetableInfoViewModel())        );        GoCreateTimetable = ReactiveCommand.CreateFromObservable(            () => Router.Navigate.Execute(new CreateTimetableViewModel(this))        );        GoSchoolInfo = ReactiveCommand.CreateFromObservable(            () => Router.Navigate.Execute(new SchoolInfoViewModel(this))        );        GoCreateProfile = ReactiveCommand.CreateFromObservable(            () => Router.Navigate.Execute(new CreateSchoolProfileViewModel())        );    }    public ReactiveCommand<Unit, IRoutableViewModel> GoCreateProfile { get; }    public ReactiveCommand<Unit, IRoutableViewModel> GoCreateTimetable { get; }    public ReactiveCommand<Unit, IRoutableViewModel> GoTimetableInfo { get; }    public ReactiveCommand<Unit, IRoutableViewModel> GoSchoolInfo { get; }    public RoutingState Router { get; } = new();}